CREATE TABLE municipios
(
  id_continente numeric(1,0) NOT NULL, -- Codigo del Continente
  nombre_continente character varying(100) NOT NULL, -- Nombre del Continente
  id_pais numeric(4,0), -- Codigo del Pais
  nombre_pais character varying(100) NOT NULL, -- Nombre del Pais
  id_departamento numeric(4,0), -- Codigo del Departamento
  nombre_departamento character varying(100) NOT NULL, -- Nombre del Departamento
  id_municipio numeric(4,0), -- Codigo del Municipio
  nombre_municipio character varying(100) NOT NULL, -- Nombre del Municipio
  fecha_creacion character varying(100), -- Fecha en la que se inserta en base de datos el municipio
  creador_municipio character varying(100), -- Usuario que inserta el municipio
  fecha_modificacion character varying -- Fecha de modificacion del registro
)
WITH (
  OIDS=FALSE
);
ALTER TABLE municipios OWNER TO postgres;
COMMENT ON TABLE municipios IS 'Listado Continentes-Paises-Departamentos-Municipios';
COMMENT ON COLUMN public.municipios.id_continente IS 'Codigo del Continente';
COMMENT ON COLUMN public.municipios.nombre_continente IS 'Nombre del Continente';
COMMENT ON COLUMN public.municipios.id_pais IS 'Codigo del Pais';
COMMENT ON COLUMN public.municipios.nombre_pais IS 'Nombre del Pais';
COMMENT ON COLUMN public.municipios.id_departamento IS 'Codigo del Departamento';
COMMENT ON COLUMN public.municipios.nombre_departamento IS 'Nombre del Departamento';
COMMENT ON COLUMN public.municipios.id_municipio IS 'Codigo del Municipio';
COMMENT ON COLUMN public.municipios.nombre_municipio IS 'Nombre del Municipio';
COMMENT ON COLUMN public.municipios.fecha_creacion IS 'Fecha en la que se inserta en base de datos el municipio';
COMMENT ON COLUMN public.municipios.creador_municipio IS 'Usuario que inserta el municipio';
COMMENT ON COLUMN public.municipios.fecha_modificacion IS 'Fecha de modificacion del registro';



